import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('https://webapi.partcommunity.com/service/table/vertical?apikey=e66120f9d9624823884cac1bf290ea88&language=english&eol=1&plm=true&includeunclassifiedbycountry=false&enablePreviewPerLine=true&path=bosch_rexroth_cytro/power_units/std_power_units/cytropac_asmtab.prj&includecrossref=true');
        const result = await response.json();
        setData(result);
      } catch (error) {
        console.error('Error fetching the data', error);
      }
    };

    fetchData();
  }, []);

  if (!data) {
    return <div>Loading...</div>;
  }

  const cnsordernoValue = data.index.line.values.CNSORDERNO.values[0].value;
  const mnValue = data.index.line.values.MN.values[0].value;
  const typeValue = data.index.line.values.TYP.values[0].value;
  const csValue = data.index.line.values.CS.values[0].value;
  const tsValue = data.index.line.values.TS.values[0].value;
  const drValue1 = data.index.line.values.DR.values[0].name;
  const drValue2 = data.index.line.values.DR.values[1].name;
  const pcValue1 = data.index.line.values.PC.values[0].name;
  const pcValue2 = data.index.line.values.PC.values[1].name;
  const pcValue3 = data.index.line.values.PC.values[2].name;
  const pcValue4 = data.index.line.values.PC.values[3].name;
  const pmValue1 = data.index.line.values.PM.values[0].name;
  const pmValue2 = data.index.line.values.PM.values[1].name;
  const pmValue3 = data.index.line.values.PM.values[2].name;
  const pmValue4 = data.index.line.values.PM.values[3].name;
  const opValue = data.index.line.values.OP.values[0].name;
  const stValue1 = data.index.line.values.ST.values[0].name;
  const stValue2 = data.index.line.values.ST.values[1].name;
  const stValue3 = data.index.line.values.ST.values[2].name;
  const ctValue1 = data.index.line.values.CT.values[0].name;
  const ctValue2 = data.index.line.values.CT.values[1].name;
  const ctValue3 = data.index.line.values.CT.values[2].name;
  const flValue = data.index.line.values.FL.values[0].name;
  const colValue = data.index.line.values.COL.values[0].name;
  const fdValue1 = data.index.line.values.FD.values[0].name;
  const fdValue2 = data.index.line.values.FD.values[1].name;
  const fdValue3 = data.index.line.values.FD.values[2].name;
  const fdValue4 = data.index.line.values.FD.values[3].name;


  return (
    <div>
      <p>Order Number: {cnsordernoValue}</p>
      <p>Material Number: {mnValue}</p>
      <p>Type: {typeValue}</p>
      <p>Component series: {csValue}</p>
      <p>Tank size: {tsValue}</p>
      <form>
      <label>Drive:</label>
      <select>
        <option>{drValue1}</option>
        <option>{drValue2}</option>
      </select>
      </form>
      <br></br>
      <form>
      <label>Performance Class:</label>
      <select>
        <option>{pcValue1}</option>
        <option>{pcValue2}</option>
        <option>{pcValue3}</option>
        <option>{pcValue4}</option>
      </select>
      </form>
      <br></br>
      <form>
      <label>Pump Design:</label>
      <select>
        <option>{pmValue1}</option>
        <option>{pmValue2}</option>
        <option>{pmValue3}</option>
        <option>{pmValue4}</option>
      </select>
      </form>
      <p>Operating Pressure: {opValue}</p>
      <form>
      <label>Sensor Technology:</label>
      <select>
        <option>{stValue1}</option>
        <option>{stValue2}</option>
        <option>{stValue3}</option>
      </select>
      </form>
      <br></br>
      <form>
      <label>Cooling type / maximum cooling power fluid:</label>
      <select>
        <option>{ctValue1}</option>
        <option>{ctValue2}</option>
        <option>{ctValue3}</option>
      </select>
      </form>
      <p>Filling: {flValue}</p>
      <p>Coloring: {colValue}</p>
      <form>
      <label>Further Details:</label>
      <select>
        <option>{fdValue1}</option>
        <option>{fdValue2}</option>
        <option>{fdValue3}</option>
        <option>{fdValue4}</option>
      </select>
      </form>
    </div>
  );
}

export default App;
